Extend interpolation with MessageFormat like syntax.

Ref: <https://docs.google.com/a/google.com/document/d/1pbtW2yvtmFBikfRrJd8VAsabiFkKezmYZ_PbgdjQOVU/edit>

Example:

```html
{{recipients.length, plural, offset:1
    =0 {You gave no gifts}
    =1 { {{ recipients[0].gender, select,
              male {You gave him a gift.}
              female {You gave her a gift.}
              other {You gave them a gift.}
          }}
       }
    one { {{ recipients[0].gender, select,
              male {You gave him and one other person a gift.}
              female {You gave her and one other person a gift.}
              other {You gave them and one other person a gift.}
          }}
       }
    other {You gave {{recipients.length}} people gifts. ({{name}}) }
}}
```

Quick note on syntax differences from MessageFormat:
- MessageFormat directives are always inside {{ }} instead of
  single { }.  This ensures a consistent interpolation syntax (else you
  could interpolate in more than one way and have to pick one based on
  feature availability for that syntax.)
- The first word inside such syntax can be an arbitrary Angular
  expression instead of a single identifier.
- You can nest them as deep as you want.  As mentioned earlier, you
  would use {{ }} to start the nested interpolation that may optionally
  include select/plural extensions.
- Only "select" and "plural" keywords are currently recognized.
- Quoting support is coming in a future commit.
- Positional arguments/placeholders are not supported. They don't make
  sense in Angular templates anyway (they are only helpful when using
  API calls from a programming language.)
- The "#" character is not special in plural messages.  This will be
  supported in a future commit.  However, since you can embed any
  Angular expression inside the message, you can still play around with
  it.  (Also, the "#" symbol doesn't nest with plurals if you're wanting
  to write full messages. Alternative syntax would be nice.)

When Angular annotates straight from function it adds `$inject` *static* field to function itself. But when Angular annotates a function from an array it subsequently doesn't add the same. It would be advantageous if it did the same as client code may also use this field's value.

Usage scenario
--
I'm following [John Papa's Angular guidelines](https://github.com/johnpapa/angularjs-styleguide) how to write better maintainable angular code. So I'm writing my controllers/services using actual prototypes and not anonymous functions. but instead of containing all behaviour within controller's constructor as John Papa does I'm actually writing prototypes. 

To work with prototypes we need all constructor injections on instantiated object so they can be accessed from other prototype functions. But to avoid tedious and error prone work of adding these manually one can write a function i.e. `injectParameters` that does it automatically. This specific function reads those either from `$inject` static field or it parses function similar as angular's annotation does. The problem happens with minified files where argument names may be different or even omitted from the ones provided in original source code. The same problem happens in Angular hence two possible injection scenarios:

* `angular.module("SomeModule").controller("SomeController", ["$scope",..., SomeController]);`
* `SomeController.$inject = ["$scope",...];`

So because Angular annotation doesn't add the `$inject` field when some controller/service was provided using the first method there is no possibility to get those names correctly in client code.

```Javascript
function MyController($scope, someResource...) {
    injectParameters(this, arguments); // all injections accessible under i.e. this.injections...
    ...
}

MyController.prototype.doSomething() {
    // injections from constructor added by injectParameters to .injections object
    this.injections.someResource.get(...);
}

